import { Button } from "@mui/material";
import { useEffect } from "react";

export const Logout = () => {
         const x = () => {

                  useEffect(() => {
                      localStorage.removeItem("token");
                      window.location = "/";
                  }, []);
         }
    return (
         <Button onClick={x}>
                  Logout
         </Button>
    );
};
